import {Button} from '../../components/Button/Button';

const Login = () =>  {
    return (
        <div> 
            <Button.Primary label="Bejelentkezés" ></Button.Primary>
            <Button label="Regisztráció"></Button>
        </div>
    )
}

export default Login;
